DROP TABLE location_sublocalities;
/

CREATE TABLE location_sublocalities (
    "ID"                         NUMBER(*, 0)
        NOT NULL ENABLE,
    "CODE"                       CHAR(2 BYTE)
        NOT NULL ENABLE,
    "LOCALITY_ID"                NUMBER(*, 0)
        NOT NULL ENABLE,
    "NAME"                       NVARCHAR2(255)
        NOT NULL ENABLE,
    "IS_PRIMARY_CANDIDATE"       NUMBER(1, 0)
        NOT NULL ENABLE,
    "SA2_NAME"                   NVARCHAR2(500),
    "MODIFIED_MOSASH_CATEGORY"   NUMBER(1, 0),
    "LATITUDE"                   NUMBER(9, 6),
    "LONGITUDE"                  NUMBER(9, 6),
    CONSTRAINT "LOC_SLCTY_CODE_ISNUM" CHECK ( translate(code, '~1234567890', '!~~~~~~~~~~') = '~~' ) ENABLE,
    CONSTRAINT "LOC_SLCTY_ISPRIM" CHECK ( is_primary_candidate IN (
        0,
        1
    ) ) ENABLE,
    CONSTRAINT "LOC_SLCTY_MMR" CHECK ( modified_mosash_category IS NULL
                                       OR modified_mosash_category BETWEEN 1 AND 7 ) ENABLE
);
/

REM INSERTING into TKC.LOCATION_SUBLOCALITIES
SET DEFINE OFF;
